import React from "react";
import { Link } from "react-router-dom";
import logo from "../images/35202504_lightning_bolt_neon.jpg";

const Navbar = () => {
  return (
    <div>
      <nav>
        <div>
          <img src={logo} alt="Logo" className="w-20"></img>
        </div>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
